def reverse(state: list[int]):
    for i in range(623, -1, -1):
        if i == 0:
            result = 0
            print(hex(state[397]))

        tmp = state[i] ^ state[(i + 397) % 624]
        if tmp & 0x80000000 == 0x80000000:
            tmp ^= 0x9908b0df

        # 2nd bit of tmp is the first bit of state[i]
        result = (tmp << 1) & 0x80000000

        # Determine last bit
        prev_tmp = state[(i - 1 + 624) % 624] ^ state[(i + 396) % 624]
        if prev_tmp & 0x80000000 == 0x80000000:
            prev_tmp ^= 0x9908b0df
            result |= 1

        # Middle 30 bits
        result |= (prev_tmp << 1) & 0x7FFFFFFE
        state[i] = result

    return state

